DROP TABLE IF EXISTS `bk_admin`;
CREATE TABLE `bk_admin` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `realname` varchar(64) NOT NULL DEFAULT '' COMMENT '姓名',
  `username` varchar(64) NOT NULL DEFAULT '' COMMENT '昵称',
  `password` varchar(32) NOT NULL,
  `tel` int(11) NOT NULL DEFAULT '0' COMMENT '手机号',
  `email` varchar(64) NOT NULL DEFAULT '' COMMENT '邮箱',
  `create_time` datetime NOT NULL,
  `last_login_time` datetime NOT NULL,
  `last_login_ip` varchar(32) NOT NULL DEFAULT '' COMMENT '最后一次登录ip',
  `last_login_num` int(11) NOT NULL DEFAULT '0' COMMENT '登录次数',
  `locked` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0:正常 1：已锁定',
  `group` int(11) NOT NULL DEFAULT '0' COMMENT '用户组',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`) COMMENT '(null)',
  KEY `username_password` (`username`,`password`) COMMENT '(null)',
  KEY `tel` (`tel`) COMMENT '(null)'
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

