-- ----------------------------
--  Table structure for `bk_article`
-- ----------------------------
DROP TABLE IF EXISTS `bk_article`;
CREATE TABLE `bk_article` (
  `a_id` int(9) NOT NULL AUTO_INCREMENT COMMENT '文章id',
  `title` varchar(60) NOT NULL COMMENT '文章标题',
  `subtitle` varchar(500) NOT NULL COMMENT '文章描述',
  `createtime` datetime DEFAULT NULL COMMENT '操作时间',
  `cid` int(9) DEFAULT NULL COMMENT '文章所属栏目id',
  `content` text COMMENT '文章内容',
  `author` varchar(255) DEFAULT '0' COMMENT '作者',
  `imgurl` varchar(255) DEFAULT NULL,
  `clicknum` int(11) NOT NULL DEFAULT '0' COMMENT '点击次数',
  `istop` int(11) NOT NULL DEFAULT '0' COMMENT '0为不置顶 1为置顶',
  `isindex` int(11) NOT NULL DEFAULT '0' COMMENT '1:首页显示，0:首页不显示',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '0为未审核 1是审核通过 2 是审核驳回',
  PRIMARY KEY (`a_id`),
  KEY `id` (`a_id`) COMMENT '(null)'
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

